import React from 'react';
import Locdialog from './Locdialog';
import { getPropertyInfo } from '../../service/api.js';
import Propertyinfo from '../Property/Propertyinfo.js';

const Page2 = (props) => {
  const [propertyData, setPropertyData] = React.useState(null);

  async function handleproperty() {
    console.log("Inside handleproperty");
    let data = await getPropertyInfo();
    console.log(data);
    setPropertyData(data);
  }
  const loc=props
  function handleagency() {
    <Locdialog loc={props.loc} setloc={props.setloc}></Locdialog>
  }

  return (
    <>
      <div className='outerpg2'>
        <div className='upperpg2'>
          Choose how would you like to display your ad
        </div>
        <div className='lowerpg2'>
          <button className='btn btn-primary' onClick={handleproperty}>
            <div className='upperbtn'>Property</div>
          </button>
          <button className='btn btn-primary' onClick={handleagency}>
            <div className='upperbtn'>Agency</div>
          </button>
        </div>
      </div>

      {propertyData && <Propertyinfo data={propertyData} />}
      {loc && <Locdialog loc={loc} setloc={setloc} />}
    </>
  );
};

export default Page2;
